int main(void){
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;

    /* set front pixel buffer to Buffer 1 */
    *(pixel_ctrl_ptr + 1) = (int) &Buffer1; // first store the address in the  back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer

    /* set back pixel buffer to Buffer 2 */
    *(pixel_ctrl_ptr + 1) = (int) &Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer

	draw_role('p', 50, 50, 0);
	for (int i = 10000000; i > 0; i--){}
	wait_for_vsync(); // swap front and back buffers on VGA vertical sync
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	clear_screen();
	draw_role('t', 50, 50, 0);
	for (int i = 10000000; i > 0; i--){}
	wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
}

// code for subroutines (not shown)

void plot_pixel(int x, int y, short int line_color)
{
    volatile short int *one_pixel_address;

        one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);

        *one_pixel_address = line_color;
}

void clear_screen(){
    for(int x = 0; x<=319; x++){
        for(int y=0; y<=239;y++){
            volatile short int *one_pixel_address;
            one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
            if(*one_pixel_address != 0){
                plot_pixel(x,y, 0);
            }
        }
    }
}

void swap(int* x, int* y){
    int temp = *x;
    *x = *y;
    *y = temp;
}

void wait_for_vsync(){
    int status;
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    *pixel_ctrl_ptr = 1;
    status = *(pixel_ctrl_ptr + 3);
    while((status & 1) !=0){
        status = *(pixel_ctrl_ptr + 3);
    }
}

void draw_character(char Char, int x, int y, int clear){
    // to draw the character wanted, fill in the character, index x, index y, 0
    // index (x, y) indicates the up left corner of the character drawn
    // index count from the top left corner of the VGA display
    // if want to clear the character, remain others the same and set clear to 1
    if (x <0 || y < 0 || x > 299 || y > 219){
        draw_character('o', 20, 50, 0);
        draw_character('u', 40, 50, 0);
        draw_character('t', 60, 50, 0);
        draw_character('o', 80, 50, 0);
        draw_character('f', 100, 50, 0);
        draw_character('b', 120, 50, 0);
        draw_character('o', 140, 50, 0);
        draw_character('u', 160, 50, 0);
        draw_character('n', 180, 50, 0);
        draw_character('d', 200, 50, 0);
    }
    if (clear){
        for (int i = 0; i <= 49; i++){
            for (int j = 0; j <= 19; j++){
                plot_pixel(x+j, y+i, 0);
            }
        }
    }
    else{
        // tell which character to plot
        uint16_t (*selectedArray)[20] = char_select(Char);

        //plot the character
        for (int i = 0; i <= 49; i++){
            for (int j = 0; j <= 19; j++){
                plot_pixel(x+j, y+i, selectedArray[i][j]);
            }
        }
    }
}

